INSERT INTO `reviews` (`album_id`, `grade`, `review`) VALUES ('271', 8, 'In consequatur repellat amet labore quis. Consequuntur voluptas consequatur et dicta omnis corrupti repellat. Voluptatum incidunt asperiores est eius eveniet ratione deserunt.\nQui architecto hic quis dolore. Assumenda dignissimos numquam repudiandae aliquam odio quo iste doloribus.');
INSERT INTO `reviews` (`album_id`, `grade`, `review`) VALUES ('22', 84, 'Inventore et debitis officia. Nam non iste ab hic sed quaerat. Ad ut perspiciatis tenetur et deleniti. Dolore est aut fugiat dolorem tempora ipsam. Aliquam inventore aut beatae perspiciatis aut.\nUt voluptas sunt fugit ut enim aut atque. Voluptas explicabo voluptatum qui sit.');
INSERT INTO `reviews` (`album_id`, `grade`, `review`) VALUES ('240', 52, 'In saepe tempora facilis amet quia eos aperiam. Consequuntur dolor provident sequi est. Sed ducimus similique qui quidem veniam voluptatem sunt.\nPerferendis illo suscipit explicabo vero nulla non fugiat. Occaecati voluptate consectetur qui placeat. Labore sit alias facilis quod quaerat nam.');
INSERT INTO `reviews` (`album_id`, `grade`, `review`) VALUES ('283', 3, 'Sunt dolorem numquam sunt et quidem unde. Eveniet at eius ratione nesciunt vitae quae nulla. Quam perferendis ratione sit consequatur ipsum quam est. Cupiditate minus est aliquid error est sunt ut.\nVoluptates qui corrupti repellat et qui. Ut sed nihil dolores consequatur odio voluptas.');
INSERT INTO `reviews` (`album_id`, `grade`, `review`) VALUES ('258', 46, 'Tempore temporibus velit tempora assumenda est labore est ea. Quod dicta recusandae enim eveniet laboriosam. Est recusandae sint mollitia perferendis maxime. Consectetur ducimus omnis et nam quibusdam facilis culpa.');
