-- Наполнение БД с помощью сайта Fulldb



UPDATE albums SET catalog_label_number = 'N/A' WHERE label_id = 1;
UPDATE albums SET catalog_label_number = 'N/A' WHERE catalog_label_number = '';


DROP TEMPORARY TABLE IF EXISTS idx;
CREATE TEMPORARY TABLE idx (
  id BIGINT
);

SELECT DISTINCT albums.id
FROM bands
JOIN bands_albums
ON bands.id = bands_albums.band_id
JOIN albums
ON albums.id = bands_albums.album_id
WHERE bands.formed_in > SUBSTRING(albums.release_date, 1, 4);

UPDATE albums SET release_date = CURDATE() WHERE albums.id IN(SELECT * FROM idx);
UPDATE albums SET release_date = DATE_FORMAT(release_date, '%b %D, %Y') WHERE release_date IS NOT NULL;
UPDATE albums SET limitation = CONCAT(limitation, ' copies') WHERE limitation != '';
UPDATE albums SET album_image_link = CONCAT('https://www.metal-archives.com/images/albums/', id, '.jpg') WHERE album_image_link != '';

DROP TEMPORARY TABLE idx;


DROP TEMPORARY TABLE IF EXISTS grades;
CREATE TEMPORARY TABLE grades (
  album_id BIGINT,
  count_grades INT,
  avg_grades INT
);

SELECT album_id, COUNT(*), ROUND(AVG(grade))
FROM reviews
GROUP BY album_id;

UPDATE albums SET reviews_count = (
  SELECT count_grades
  FROM grades
  WHERE albums.id = grades.album_id
  );
  
UPDATE albums SET reviews_avg_rating = (
SELECT avg_grades 
FROM grades 
WHERE albums.id = grades.album_id
);

DROP TEMPORARY TABLE grades;